207 pages | Sep 22 2008 |ISBN: 1905862156 | PDF | 1.2 Mb

DESCRIPTION:

The name says it all: This is the cookbook for anyone with a busy life and a tight budget.In todays world it is easy to find yourself short on time and money. Cooking for your family while working fulltime seems nearly impossible. But Gill Holcombe proves that with healthy ingredients and stress-free recipes you can feed your family of four for less that $45 a week. Filled with simple, wholesome and nutritious recipes, this brilliant little cookbook will save you from spending hours slaving over a hot stove or spending a fortune at the supermarket. It is a must-have kitchen companion for the modern family. 

